import React from 'react'
import styled from 'styled-components';
import Burger from './Burger'


const Nav = styled.nav`
  width: 80%;
  height: 55px;
  margin: 0 auto;
  border-bottom: 2px solid #f1f1f1;
  padding: 0 20px;
  display: flex;
  justify-content: space-between;
  .logo {
    padding: 15px 0;
    height: 10px;
    width: 10px;
    color: brown;
  }
  `

const Navbar = () => {

    return (

      <Nav>
      <div className = 'logo'>
        Coffee Shope
      </div>   
        <Burger/> 
    </Nav>


    );
}

export default Navbar
